    def GenderCreation(probability_of_man = 0.7, probability_of_woman = 0.29) -> str:
        random_value = np.random.uniform(0,1,1)[0]
        if random_value <= probability_of_man:
            return "Mужчина"
        elif random_value > probability_of_man and random_value <= probability_of_man + probability_of_woman:
            return "Женщина"
        else:
            return "Неопределенный"
        
