    def UserSmokerSearch(non_smoke_prob = 0.95, smoke_prob = 0.01) -> str:
        random_variable = np.random.uniform(0,1,1)[0]
        if  random_variable <= non_smoke_prob:
            return "Не Курит"
        elif random_variable > non_smoke_prob and random_variable <= non_smoke_prob + smoke_prob:
            return "Не важно курит или нет"
        else:
            return "Курит"

    
